import React, { Component } from "react";
import { Navigate, Route,Outlet } from "react-router-dom";
import AuthHandler from "./AuthHandler";


const PrivateRoute = () => {
    
  return (
    AuthHandler.loggedIn() ? <Outlet/> : <Navigate to='/'/>
    )
  }
